map_x = parse_map(data_str_x)
map_y = parse_map(data_str_y)

# Toggle between scalar heatmap (False) and vector field (True)
vector_mode = True

# Create plot
fig, ax = plt.subplots(figsize=(4, 4))

if vector_mode:
    # Full grid and magnitude
    nrows, ncols = map_x.shape
    X, Y = np.meshgrid(np.arange(ncols), np.arange(nrows))
    magnitude = np.sqrt(map_x**2 + map_y**2)

    # Downsample arrows: one arrow every 5 cells
    step = 5
    X_ds = X[::step, ::step]
    Y_ds = Y[::step, ::step]
    map_x_ds = map_x[::step, ::step]
    map_y_ds = map_y[::step, ::step]
    mag_ds = magnitude[::step, ::step]

    ax.quiver(
        X_ds, Y_ds, map_x_ds, map_y_ds,
        mag_ds,
        cmap='inferno',
        scale_units='xy',
        angles='xy',
        scale=1,
        width=0.005,
        headwidth=3,
        headlength=4,
    )
    ax.set_title("Vector Map", fontsize=14, fontweight='bold')
else:
    sns.heatmap(
        map_x,
        cmap="terrain",
        square=True,
        cbar=True,
        linewidths=0,
        linecolor=None,
        xticklabels=False,
        yticklabels=False,
        annot=False,
        ax=ax
    )
    ax.set_title("Heatmap of X Component", fontsize=14, fontweight='bold')

# Remove axes ticks
ax.set_xticks([])
ax.set_yticks([])

# Ensure equal aspect ratio for a square plot
ax.set_aspect('equal')

plt.tight_layout()
plt.show()
